import '../styles/Home-down.css'

function HomeDown(){
    return(
        <>
            <div className={'parent'}>
                <div className={'c1'}>
                    <ul className={'HomeDown-list'}>
                        <li><h3>Ab</h3></li>
                    </ul>
                </div>
                <div className={'c2'}>2</div>
                <div className={'c3'}>3</div>
            </div>
        </>
    );
}

export  default HomeDown;
